//注册
//心跳包
message m_heart_bit_tos{
        optional int32 time = 1;
}
message m_heart_bit_toc{
        optional int32   time 	= 1;
}
//获取服务器列表
message m_server_list_tos{
        optional int32 time = 1;
		optional string sign = 2;
}
message m_server_list_toc{
        optional string   addr 	= 1;	//域名或者ip
		optional int32    port 	= 2;	//端口
}

message m_account_init_toc {
        optional  int32  init_num = 1;                  // 初始值
        optional  int32 add_num = 2;                // 步长
        optional  int32 time = 3;                // 时间戳
}

//游客快速登录，已有账号密码登录
message m_login_tos {
        optional string mac = 1[default = ""];                	 	 // mac        
        optional int32 agent_id = 2;                     			// 包号或者代理号
		optional string phone_type = 3[default = ""]; 	     	     // 手机型号
		optional string  account = 4[default = ""];               	 // 账号
		optional string  passwd = 5[default = ""];               	 // 密码
		optional int32  timestamp = 6;               	 			// 时间戳
		optional string nickname = 7[default = ""]; 	     	     // 角色名
		optional int32 head = 8[default = 0];                     	// 头像
}
message m_login_toc {
		optional int32  result = 1[default = 0];           //成功返回
}
